INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 2, "2020/07/31 12:00:00", 102301, 0.0, 2, "2030/12/17 14:59:59", 10046, 401, "アヤネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 1, "2020/07/31 12:00:00", 102301, 2.21, 2, "2030/12/17 14:59:59", 10046, 402, "アヤネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 2, "2020/07/31 12:00:00", 102301, 0.0, 2, "2030/12/17 14:59:59", 10046, 403, "アヤネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 2, "2020/07/31 12:00:00", 192201, 1.99, 1, "2030/12/17 14:59:59", 10046, 701, "アサヒ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 1, "2020/07/31 12:00:00", 192201, 2.21, 2, "2030/12/17 14:59:59", 10046, 702, "アサヒ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 2, "2020/07/31 12:00:00", 192201, 3.33, 1, "2030/12/17 14:59:59", 10046, 703, "アサヒ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 2, "2020/07/31 12:00:00", 192301, 0.0, 2, "2030/12/17 14:59:59", 10046, 801, "部員３");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 1, "2020/07/31 12:00:00", 192301, 2.68, 2, "2030/12/17 14:59:59", 10046, 802, "部員３");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 2, "2020/07/31 12:00:00", 192301, 0.0, 2, "2030/12/17 14:59:59", 10046, 803, "部員３");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "やった！", 24010, 1, "2020/07/31 12:00:00", 192501, 0.0, 1, "2030/12/17 14:59:59", 10046, 501, "");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "勝ったよ！", 24011, 1, "2020/07/31 12:00:00", 192501, 0.0, 1, "2030/12/17 14:59:59", 10046, 502, "");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "いい調子！", 24012, 1, "2020/07/31 12:00:00", 192501, 0.0, 1, "2030/12/17 14:59:59", 10046, 503, "");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 6, "2020/07/31 12:00:00", 113501, 5.33, 2, "2030/12/17 14:59:59", 10046, 111, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 1, "2020/07/31 12:00:00", 113501, 6.85, 2, "2030/12/17 14:59:59", 10046, 112, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 1, "2020/07/31 12:00:00", 113501, 3.0, 2, "2030/12/17 14:59:59", 10046, 113, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 1, "2020/07/31 12:00:00", 192401, 6.11, 2, "2030/12/17 14:59:59", 10046, 611, "ダイチ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 1, "2020/07/31 12:00:00", 192401, 6.75, 2, "2030/12/17 14:59:59", 10046, 612, "ダイチ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 2, "2020/07/31 12:00:00", 192401, 0.0, 2, "2030/12/17 14:59:59", 10046, 613, "ダイチ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 2, "2020/07/31 12:00:00", 113401, 4.52, 1, "2030/12/17 14:59:59", 10046, 211, "ハツネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 2, "2020/07/31 12:00:00", 113401, 3.89, 1, "2030/12/17 14:59:59", 10046, 212, "ハツネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 1, "2020/07/31 12:00:00", 113401, 13.49, 2, "2030/12/17 14:59:59", 10046, 213, "ハツネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 1, "2020/07/31 12:00:00", 106501, 3.17, 2, "2030/12/17 14:59:59", 10046, 311, "カヤ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 1, "2020/07/31 12:00:00", 106501, 4.42, 2, "2030/12/17 14:59:59", 10046, 312, "カヤ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 6, "2020/07/31 12:00:00", 106501, 2.89, 1, "2030/12/17 14:59:59", 10046, 313, "カヤ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 4, "2020/07/31 12:00:00", 102301, 3.71, 3, "2030/12/17 14:59:59", 10046, 421, "アヤネ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 2, "2020/07/31 12:00:00", 192201, 5.1, 1, "2030/12/17 14:59:59", 10046, 721, "アサヒ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 1, "2020/07/31 12:00:00", 192301, 4.34, 3, "2030/12/17 14:59:59", 10046, 821, "部員３");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 0.0, 24, "いい勝負だったよ\nまたやろうね", 24028, 1, "2020/07/31 12:00:00", 192501, 0.0, 1, "2030/12/17 14:59:59", 10046, 521, "");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (-360.0, 0.0, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 1, "2020/07/31 12:00:00", 113501, 5.62, 2, "2030/12/17 14:59:59", 10046, 101, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (-360.0, 0.0, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 1, "2020/07/31 12:00:00", 113501, 9.58, 2, "2030/12/17 14:59:59", 10046, 102, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (-360.0, 0.0, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 2, "2020/07/31 12:00:00", 113501, 0.0, 2, "2030/12/17 14:59:59", 10046, 103, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (-360.0, 0.0, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 2, "2020/07/31 12:00:00", 113501, 9.13, 1, "2030/12/17 14:59:59", 10046, 104, "ミサト");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (-360.0, 0.0, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 1, "2020/07/31 12:00:00", 113501, 8.27, 2, "2030/12/17 14:59:59", 10046, 105, "ミサト");
